import { useEffect, useState } from "react";

function CustomerList(){ 

    const [customers,setCustomers] = useState([]);

    useEffect(() =>{
        axios.get("http://localhost:8080/customers").
        then(response => {
            setCustomers(response.data)
            
        })
    },[])
    
    return(
        <div>
            {customers.map( data => {
                <Customer data={data}/>
            })}
        </div>
    );
}
export default CustomerList;
